CREATE DATABASE IF NOT EXISTS `catalog`;

CREATE TABLE IF NOT EXISTS `catalog`.`categories` (
`id` INT UNSIGNED NOT NULL,
`name` VARCHAR(250) NOT NULL ,
PRIMARY KEY(`id`)
);

CREATE TABLE IF NOT EXISTS `catalog`.`brands` (
`id` INT UNSIGNED NOT NULL,
`name` VARCHAR(200),
`category` INT,
PRIMARY KEY(`id`),
CONSTRAINT `category` FOREIGN KEY(`category`) REFERENCES `catalog`.`categories`(`id`) ON DELETE RESTRICT ON UPDATE CASCADE
);

CREATE TABLE IF NOT EXISTS `catalog`.`products` (
`id` INT,
`title` VARCHAR(100),
`description` VARCHAR(250),
`price` INT,
`discount` INT,
`rating` INT,
`stock` INT,
`imageurl` VARCHAR(250),
`brand_id` INT,
`category_id` INT,
PRIMARY KEY(`id`) ,
INDEX `CATEGORY_ID`(`category_id` ASC) ,
INDEX `BRAND_ID`(`brand_id` ASC) ,
CONSTRAINT `brand_id` FOREIGN KEY(`brand_id`) REFERENCES `catalog`.`brands`(`id`) ON DELETE RESTRICT ON UPDATE CASCADE ,
CONSTRAINT `category_id` FOREIGN KEY(`category_id`) REFERENCES `catalog`.`categories`(`id`) ON DELETE RESTRICT ON UPDATE CASCADE
);

CREATE TABLE IF NOT EXISTS `catalog`.`images` (
`id` INT UNSIGNED NOT NULL,
`image1` TEXT,
`image2` TEXT,
`image3` TEXT,
`image4` TEXT,
`image5` TEXT,
`image6` TEXT,
PRIMARY KEY(`id`) ,
CONSTRAINT `id` FOREIGN KEY(`id`) REFERENCES `catalog`.`products`(`id`)
);

use catalog;




